ext_Caption_123:{type:19,from:90001,to:108000,rp:0,rpa:0,mdi:'Text_Caption_123c',retainState:false,immo:false,apsn:'Slide14664',trin:0,trout:0,stl:[{stn:'Normal',stt:0,stsi:[14733]}],stis:0,bstiid:-1,sipst:0,sicbs:false,sihhs:false,sihds:false},Text_Caption_123c:{b:[49,213,403,597],uid:14733,sr:cp.fd,ip:'dr/Text_Caption_123.png',dn:'Text_Caption_123',visible:1,effectiveVi:1,JSONEffectData:false,accstr:'Political scientists have conducted a lot of research on trends in party unity and party polarization for the parties in government by gathering data on roll call votes by members of Congress. Political scientists Keith Poole and Howard Rosenthal have been the principal investigators of roll call voting data and they provide data access and some results of their work on Voteview.com. The graph, right, shows the historical trend in party polarization by measuring the distance between Democrats and Republicans in both houses for each year of congress from 1879–2104. The larger the distance between the lines, the more unified and more polarized the parties. Higher values mark more party polarization and low values indicate less polarization within each party. ',traccstr:'',ti:-1,hl:'HL14751_0_0,',vbwr:[49,213,403,597],vb:[49,213,403,597]},Text_Caption_124:{type:19,from:90001,to:108000,rp:0,rpa:0,mdi:'Text_Caption_124c',retainState:false,immo:false,apsn:'Slide14664',trin:0,trout:0,stl:[{stn:'Normal',stt:0,stsi:[14742]}],stis:0,bstiid:-1,sipst:0,sicbs:false,sihhs:false,sihds:false},Text_Caption_124c:{b:[444,560,975,597],uid:14742,sr:cp.fd,ip:'dr/Text_Caption_124.png',dn:'Text_Caption_124',visible:1,effectiveVi:1,JSONEffectData:false,accstr:'(Click image for a larger version.) ',traccstr:'',ti:-1,vbwr:[444,560,975,597],vb:[444,560,975,597]},Image_129:{type:15,from:90001,to:108000,rp:0,rpa:0,mdi:'Image_129c',retainState:false,immo:false,apsn:'Slide14664',trin:0,trout:0,stl:[{stn:'Normal',stt:0,stsi:[14761]}],stis:0,bstiid:-1,sipst:0,sicbs:false,sihhs:false,sihds:false},Image